import { StyleSheet } from "react-native";

export const styles = StyleSheet.create({
  title: {
    fontSize: 25,
    color: "white",
    marginTop: 15,
    alignSelf: "flex-start",
    marginLeft: 20,
    fontWeight: "semibold",
  },
});
